INSERT INTO `chartemplate` VALUES (167, 'Beerus', 0, 508, 509, 510, 0, 1000000000, 1000000, 100000, 400, 10, 0, 10, '[113]', 0, 0, 0, 0, -1, -1, 1, 1000, 1, 0, 2, 0, '[[2,\"Ta là Beerus mạnh mẽ, và ta không quen với sự vô lễ như vậy.\"],[2,\"Ta khá quan tâm đến việc \'Siêu Saiyan Thần\' này. Ngươi có biết gì về nó không?\"],[2,\"Ngươi chắc chắn muốn chết khi thách thức một vị thần.\"],[3,\"Làm một vị thần thật nhàm chán. Không có gì thú vị hơn sao?\"],[4,\"|27|1|0|2000\"],[4,\"|41|3|500|2500\"],[4,\"Hủy diệt|37|10|300|5000\"]]');
INSERT INTO `chartemplate` VALUES (168, 'Whis', 0, 838, 839, 840, 0, 1000000, 1000000, 50000, 500, 20, 10, 30, '[0]', 0, 0, 0, 0, 100, -1, 1, 1000, 1, 0, 2, 0, '[[2,\"Tôi là người phục vụ cho thần hủy diệt Beerus, Thần Phá Hủy Diệt của Vũ trụ 7. Tôi là Whis.\"],[2,\"Tôi không tốt cũng không xấu. Tôi là một sức mạnh lớn hơn những gì bạn có thể hiểu.\"],[2,\"Thần Hủy Diệt Beerus, bạn đang hành động khá vội vã, phải không?\"],[3,\"Chúng tôi không chiến đấu. Chúng tôi hủy diệt.\"],[4,\"|13|1|0|2000\"],[4,\"|34|3|500|2500\"],[4,\"Hô Hô Hô|21|10|300|5000\"]]');
INSERT INTO `chartemplate` VALUES (169, 'Chilld', 0, 1024, 1025, 1026, 0, 1, 1000000, 100000, 500, 20, 0, 5, '[0]', 0, 0, 0, 0, 833333, -1, 1, 1000, 1, 0, 2, 0, '[[2,\"Các ngươi tới số rồi mới gặp phải ta\"],[2,\"Trai hư không phải diễn\"],[2,\"Các ngươi nghĩ có thể hạ gục được ta\"],[4,\"|13|1|0|2000\"],[4,\"|34|3|500|2500\"],[4,\"Trận địa pháo mini|21|10|300|5000\"]]');
