INSERT INTO `radatemplate` VALUES (859, 1568, 5, 40, -1, 144, 145, 146, -1, 'Thẻ Độc Nhãn', 'Đầu não của Red Ribbon. Bị chột một mắt. Lúc nhỏ bị mọi người chê là \'Thằng lùn\'', '[[175,5,0],[175,8,1],[175,11,2]]');
INSERT INTO `radatemplate` VALUES (956, 8935, 6, 30, -1, 994, 995, 996, -1, 'Thẻ Đội trưởng Vàng', 'Đội trưởng Vàng là một con hổ hình người chắc nịch có cơ thể được bao phủ bởi bộ lông màu vàng, Goku đã đấm hắn ra khỏi máy bay của mình khi đang ở giữa không trung.', '[[50,1,0],[50,2,1],[50,3,2]]');
INSERT INTO `radatemplate` VALUES (1204, 11048, 6, 30, -1, 1204, 1205, 1206, -1, 'Thẻ Rồng thần Namếc', 'Rồng thần của Namếc do trưởng lão hành tinh này tạo ra. Khác với Rồng thiêng của Trái Đất, Rồng thần Namếc có thân hình màu xanh to lớn, đồ sộ và đáng sợ hơn. Có thể thực hiện 3 điều ước.', '[[77,1,0],[103,1,0],[5,1,0],[77,2,1],[103,2,1],[5,2,1],[77,3,2],[103,3,2],[5,3,2]]');
INSERT INTO `radatemplate` VALUES (2043, 4847, 5, 100, -1, 508, 509, 510, -1, 'Thẻ Beerus', 'Beerus là vị thần mạnh nhất trong vũ trụ 7, ngay cả các Kaio cũng phải khiếp sợ ông. (100 mảnh / lv )', '[[0,100,0],[0,200,1],[0,300,2],[0,400,3],[0,500,4]]');
INSERT INTO `radatemplate` VALUES (2044, 4879, 5, 100, -1, 511, 512, 513, -1, 'Thẻ Champa', 'Champa là một vị Thần Hủy Diệt người cai quản cả vũ trụ thứ 6, luôn đi cùng với \"người giám hộ\" kiêm giáo viên của mình Vados. (100 mảnh / lv )', '[[6,1000,0],[6,2000,1],[6,3000,2],[6,4000,3],[6,5000,4]]');
INSERT INTO `radatemplate` VALUES (2045, 6815, 5, 100, -1, 739, 740, 741, -1, 'Thẻ Piccolo', 'Piccolo là 1 phản diện về sau là người bạn thân của Goku cũng là người thầy của Gohan (100 mảnh / lv )', '[[7,1000,0],[7,2000,1],[7,3000,2],[7,4000,3],[7,5000,4]]');
INSERT INTO `radatemplate` VALUES (2046, 11529, 5, 100, -1, 1254, 1255, 1256, -1, 'Thẻ Cumber', 'Cumber là một chiến minh mạnh mẽ tại hành tinh ngục tù (100 mảnh / lv )', '[[47,100,0],[47,200,1],[47,300,2],[47,400,3],[47,500,4]]');
INSERT INTO `radatemplate` VALUES (2047, 8211, 5, 50, -1, 903, 904, 905, -1, 'Thẻ Zamasu', 'Zamasu là 1 người điềm tĩnh, cẩn thận trong giao tiếp cũng như chiến đấu. Hắn khá quan tâm đến tương lai của vũ trụ, luôn đặt các câu hỏi về giá trị của con người trong vũ trụ và nghi ngờ về khả năng bản thân (50 mảnh / lv )', '[[14,1,0],[14,2,1],[14,3,2]]');
INSERT INTO `radatemplate` VALUES (2048, 7679, 5, 50, -1, 505, 506, 507, -1, 'Thẻ Whis', 'Whis là thiên sứ đi theo Beerus', '[[108,1,0],[108,2,1],[108,3,2]]');
INSERT INTO `radatemplate` VALUES (2049, 2407, 5, 50, -1, 234, 235, 236, -1, 'Thẻ Xên Bọ Hung', 'Xên Bọ Hung là tác phẩm cuối cùng của nhà Bác học Gero', '[[94,1,0],[94,2,1],[94,3,2]]');
INSERT INTO `radatemplate` VALUES (2050, 4300, 5, 50, -1, 439, 440, 441, -1, 'Thẻ Kid Buu', 'Kid buu là trạng thái nguyên thủy của Mabu', '[[204,1,0],[204,2,1],[204,3,2]]');
INSERT INTO `radatemplate` VALUES (2051, 1348, 5, 50, -1, 237, 238, 239, -1, 'Thẻ Android 17', ' Android 17 là một con người bình thường, em trai song sinh với Android 18. Sau này bị Dr. Gero cải tạo thành người máy nhằm mục đích trả thù Goku', '[[183,1,0],[183,2,1],[183,3,2]]');
INSERT INTO `radatemplate` VALUES (2052, 3852, 5, 50, -1, 386, 387, 388, -1, 'Thẻ Warrior', 'Warrior là Siêu Chiến Binh của hành tinh Namek', '[[182,1,0],[182,2,1],[182,3,2]]');
INSERT INTO `radatemplate` VALUES (2053, 5141, 5, 50, -1, 550, 551, 552, -1, 'Mảnh Black Goku', 'Black Goku là nhân vật phản diện do Zamasu ăn trộm cơ thể của goku', '[[181,1,0],[181,2,1],[181,3,2]]');
